const appartList = [
    'appart 1',
    'appart 2',
    'appart 3',
    'appart 4',
    'appart 5',
    'appart 6'
]

function AppartementsList() {
    return (
        <ul>
            {appartList.map((appart) => (
                <li>{appart}</li>
            ))}
        </ul>
    )
}

function ShoppingList() {
    return (
        <ul>
            {plantList.map((plant) => (
                <li>{plant}</li>
            ))}
        </ul>
    )
}

export default ShoppingList
